      setPage(pagep);
  }

  return (
    <> 
    <div className=''><Navbar/></div>

 

    <div className='tabBody'>

    <div className='Tabbar'> <TabBar setpage={handlePageSet}/></div>


    <div className='Body'> <Body/></div>

    </div>
    </>
  )
}

export default Home
